import React from 'react';
import { NavigationContainer, StackActions } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack';
import { createDrawerNavigator } from '@react-navigation/drawer';

import AppMenu from './components/Menu.js';

import {
  HomeScreen,
  LoginScreen,
  RegisterScreen,
  ForgotPasswordScreen,
  Dashboard,
  UpdateUserInformation,
  CreateUpdateProfile,
  ClockInOut,
  TimeSummary,
  ContactsScreen,
  CreateContactScreen
} from './screens';

import global from './global.js';

const Stack = createStackNavigator();
const Drawer = createDrawerNavigator();

global.Profile = {homePhone: '', workPhone: '', cellPhone: '', address: '', bio: '', hobbies: []};
global.User = '';
global.Token = '';

const testScreen = () => {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="Dashboard"
        component={Dashboard}
        options={{
          title: 'Dashboard',
          headerRight: () => <AppMenu />,
        }}
      />
    </Stack.Navigator>
  );
}

const drawerNav = () => {
  return (
    <Drawer.Navigator>
      {/* <Drawer.Screen name="Home" component={HomeScreen} />
      <Drawer.Screen
        name="LoginScreen"
        component={LoginScreen}
        options={{
          title: 'Login',
        }}
      />
      <Drawer.Screen
        name="RegisterScreen"
        component={RegisterScreen}
        options={{
          title: 'Register',
        }}
      />
      <Drawer.Screen
        name="ForgotPasswordScreen"
        component={ForgotPasswordScreen}
        options={{
          title: 'Forgot Password',
        }}
      /> */}
      <Drawer.Screen
        name="Dashboard"
        component={Dashboard}
        options={{
          title: 'Dashboard',
        }}
      />
      <Drawer.Screen
        name="UpdateUserInformation"
        component={UpdateUserInformation}
        options={{
          title: 'User Information',
        }}
      />
      <Drawer.Screen
        name="CreateUpdateProfile"
        component={CreateUpdateProfile}
        options={{
          title: 'Profile',
        }}
      />
      <Drawer.Screen name="ClockInOut" component={ClockInOut} />
      <Drawer.Screen name="TimeSummary" component={TimeSummary} />
      <Drawer.Screen
        name="ContactsScreen"
        component={ContactsScreen}
        options={{
          title: 'Contacts',
        }}
      />
      <Drawer.Screen
        name="CreateContactScreen"
        component={CreateContactScreen}
        options={{
          title: 'Create Contact',
        }}
      />
    </Drawer.Navigator>
  );
}

const AppStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen
          name="LoginScreen"
          component={LoginScreen}
          options={{
            title: 'Login',
          }}
        />
        <Stack.Screen
          name="RegisterScreen"
          component={RegisterScreen}
          options={{
            title: 'Register',
          }}
        />
        <Stack.Screen
          name="ForgotPasswordScreen"
          component={ForgotPasswordScreen}
          options={{
            title: 'Forgot Password',
          }}
        />
      </Stack.Navigator>
      {drawerNav}
    </NavigationContainer>
  );
};

export default AppStack;
